@namespace url("http://www.mozilla.org/keymaster/gatekeeper/there.is.only.xul");

/* Kaffie's Super-Slim Firefox Theme - Now All CSS */

/*================================*/
/* VivaldiFox Color Fix */
#browser-panel,
#TabsToolbar {
  background-color: var(--theme-accent-background);
} 

.tab-background:not([selected=true]) {
  background-color: rgba(200,200,200,0.5);
}
/*================================*/


/*================================*/
/* X on Left */
#TabsToolbar .tab-close-button { 
    -moz-box-ordinal-group: 0 !important; 
    margin-left: -6px !important;
    border-radius: 2px !important;
    transition: opacity 200ms !important;
}

#TabsToolbar .tab-icon-image:not([pinned])
{
  margin-left: 2px;
}
/*================================*/


/*================================*/
/* Safari style Auto-Expand Tabs */
#TabsToolbar .tabbrowser-tab[fadein]:not([pinned]) { 
    flex-grow: 1 !important;
    max-width: -moz-available !important;
}
/*================================*/

/*================================*/
/* Nav/Tab Bar Combine + UI Cleanup */
@namespace url(http://www.mozilla.org/keymaster/gatekeeper/there.is.only.xul);

/* Remove draggable titlebar */
#titlebar
{
        height: 0px;
        margin-top: -18px;
}
#titlebar-buttonbox-container
{
        /*-18 for old*/
        position: fixed !important; top: -21px !important; left: 0% !important;
}
.titlebar-placeholder
{
     visibility: hidden;   
}
#nav-bar {
    overflow: hidden;
    visibility: hidden;
}
#nav-bar * {
    visibility: visible;
}
#nav-bar
{
        display: block;
        text-align: right;
        position: fixed !important; top: 0% !important; left: 0% !important;
        width: 100%; /*35*/
        /*z-index: 0 !important;*/
}
#nav-bar-customization-target{
        text-align: left;
        position: fixed !important; top: 0% !important; left: 5% !important;
        margin-top: -4px;
        height: 24px;
        /*width: 400px !important; min-width: 400px !important; max-width: 400px !important;*/
        /*min-height: 5px!important;
        height: 05px!important;*/
}
#TabsToolbar {
        margin-left: 340px !important;
        z-index: 0 !important;
        margin-right: 28px;
        height: 28px;
}
#arrowscrollbox-scrollbox,
#TabsToolbar,
#tabbrowser-tabs
{
        z-index: 0 !important;
}
#PanelUI-button
{
        margin-top: -10px;
}
.autocomplete-richlistbox
{
     max-width: 800px;   
}

#TabsToolbar .scrollbutton-up,
#TabsToolbar .scrollbutton-down,
#TabsToolbar .arrowscrollbox-overflow-start-indicator, 
#TabsToolbar .arrowscrollbox-overflow-end-indicator,
#TabsToolbar .tabs-alltabs-button
{ 
    display: none !important;
}

#back-button
{
        visibility: hidden;
}
